import React from "react";
import "./App.css";

import { motion } from "framer-motion";

import "bootstrap";
import "bootstrap/dist/css/bootstrap.min.css";

function App() {
  const variants = {
    visible: { opacity: 1 },
    hidden: { opacity: 0 },
  };
  return (
    <motion.div
      initial={{ opacity: 0, x: 500 }}
      animate={{ opacity: 1, x: 0 }}
      transition={{ duration: 5 }}
    >
      <h1>Hello My Name is Manuel!!!</h1>
    </motion.div>
  );
}

export default App;
